import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from './pages/user-pages/home/home.component';
import { ArgumentsComponent } from './pages/user-pages/arguments/arguments.component';
import { ArgumentsResolverService } from './pages/user-pages/arguments/arguments-resolver.service';

import { AboutComponent } from './pages/user-pages/about/about.component';
import { DictionaryComponent } from './pages/user-pages/dictionary/dictionary.component';
import { TrueArgumentsComponent } from './pages/user-pages/true-arguments/true-arguments.component';
import { FalseArgumentsComponent } from './pages/user-pages/false-arguments/false-arguments.component';
import { IrrefutableArgumentsComponent } from './pages/user-pages/irrefutable-arguments/irrefutable-arguments.component';


const routes: Routes = [


  { path: '', component: HomeComponent },
  { path: 'about', component: AboutComponent },
  { path: 'dictionary', component: DictionaryComponent },
  { path: 'arguments', component: ArgumentsComponent, resolve: { arguments: ArgumentsResolverService} },

  { path: 'arguments/false', component: FalseArgumentsComponent },

  { path: 'arguments/irrefutable', component: IrrefutableArgumentsComponent },


 // { path: 'arguments', component: ArgumentsComponent },
  { path: 'arguments/true', component: TrueArgumentsComponent },
 // { path: 'arguments', component: ArgumentsComponent },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
